private GameObject obj3;

private void Start()
{
    // Instantiate the GameObject once at the start
    obj3 = Instantiate(gobj3);
}

private void Update()
{
    timer += Time.deltaTime;

    if (instantiate_gobj && timer >= timeLimit)
    {
        // Destroy the instantiated GameObject after the time limit is reached
        Destroy(obj3);
        instantiate_gobj = false;
    }
    else if (!instantiate_gobj && timer >= timeLimit)
    {
        // Instantiate the GameObject if not already instantiated and the time limit is reached
        obj3 = Instantiate(gobj3);
        instantiate_gobj = true;
    }

    if (displayVideoOnNextFrame)
    {
        playerUIController.HideLoader();
        photoDisplayer.DisplayVideo();
        displayVideoOnNextFrame = false;
    }
}

private void Awake()
{
    gobj3 = Instantiate(photoEntryPrefab, scrollViewContent);
    gobj3.SetActive(false);
}

private void Update()
{
    timer += Time.deltaTime;

    if (!instantiate_gobj && timer >= timeLimit)
    {
        a3 = Instantiate(gobj3);
        a3.SetActive(true);
        timer = 0;
        instantiate_gobj = true;
    }
    if (instantiate_gobj && timer >= timeLimit)
    {
        Destroy(a3);
        timer = 0;
        instantiate_gobj = false;
    }

    if (displayVideoOnNextFrame)
    {
        playerUIController.HideLoader();
        photoDisplayer.DisplayVideo();
        displayVideoOnNextFrame = false;
    }
}

